    useEffect(() => {
        fetchItems();
    },[])

    const [items, setItems] = useState([]);

    const fetchItems = async () => {

        const data = await fetch('https://fakestoreapi.com/products');
        const items = await data.json();
        setItems(items);
    }
   console.log(items);

    return(

        <>
        <h1>List Product</h1>

        </>
    )
}

export default App;
